import { useEffect } from 'react';
import { Main } from '../Component';

const Email = () => {
    useEffect(() => document.title = "Email Verification - Authentication")
    return (
        <>
            <Main label="Email or phone" labelWidth={115} type="text" name="email" />
        </>
    )
}

export default Email
